import React, { Component } from 'react';
import styled from  'styled-components';
import { Link } from 'react-router-dom';
import css from '../styles/font.css';
class Header extends Component {

    banner = () => {
        document.location.href='/';
    }
    render() {
        return (
            <Container>
                <Element>
                    <ShortCut><Link to='/login'  style={{ textDecoration: 'none',color:'#c56183', fontFamily: 'Black Han Sans, sans-serif' }}>로그인</Link>&nbsp;
                    <Link to='/join'  style={{ textDecoration: 'none',color:'#c56183', fontFamily: 'Black Han Sans, sans-serif' }}>회원가입</Link></ShortCut>
                       
                        <Search><Title onClick={this.banner}>개발자 Seok</Title></Search>
                </Element>
            </Container>
        )
    }
}


export default Header;

const Container = styled.div`
    width: 500%;
    border-bottom: 1px solid #d1d8e4;
    height: auto;
    
`

const Element = styled.div`
    margin: 0 auto;
    width: 100%;
    height: auto;
    display: flex;
    flex-flow: row wrap;
    
`

const ShortCut = styled.div`
    order: 1;
    width: 100%;
    height: auto;
    text-align: right;
    background-color: #defffd;
background-image: linear-gradient(0deg, #defffd 0%, #eff9f5 100%);

    border-radius: 3px;
    
`


const Search = styled.div`
    order: 3;
    width: 100%;
    height:auto;
    background-color: #defffd;
background-image: linear-gradient(0deg, #defffd 0%, #eff9f5 100%);

    border-radius: 3px;
    text-align: center;
    
`

const Title = styled.h1 `
   font-size: 3rem;
   font-family: 'Gugi', cursive;
  
 
color: #FA7399;

text-shadow: #5E2962 1px 1px,#5E2962 -0px 0px,
