#5E2962 -19px 19px,#5E2962 -20px 20px,
#5E2962 -21px 21px,#5E2962 -22px 22px,
#5E2962 -23px 23px,#5E2962 -24px 24px,
#5E2962 -25px 25px,#5E2962 -26px 26px,
#5E2962 -27px 27px,#5E2962 -28px 28px,
#5E2962 -29px 29px;
-shadow: #313036 1px 1px,#313036 -0px 0px,
#313036 -1px 1px,#313036 -2px 2px,#313036 -3px 3px,
#313036 -4px 4px,#313036 -5px 5px,#313036 -6px 6px,
#313036 -7px 7px,#313036 -8px 8px,#313036 -9px 9px,
#313036 -10px 10px,#313036 -11px 11px,#313036 -12px 12px,
#313036 -13px 13px,#313036 -14px 14px,#313036 -15px 15px,
#313036 -16px 16px,#313036 -17px 17px,#313036 -18px 18px,
#313036 -19px 19px,#313036 -20px 20px,#313036 -21px 21px,
#313036 -22px 22px,#313036 -23px 23px,#313036 -24px 24px,
#313036 -25px 25px,#313036 -26px 26px,#313036 -27px 27px,
#313036 -28px 28px,#313036 -29px 29px;
`
